{
    "created_time": "2016-04-17T16:21:18+0000", 
    "from": {
        "id": "1656635027906194", 
        "name": "Zin Mar Aung"
    }, 
    "id": "1759467304289632_1760555747514121", 
    "message": "ASIA Barometer Survey  အဖြဲ ့ နဲ ့ စနစ္ တက် Research ေတြ Survey ေတြ လုပ္ ခဲ ့ တဲ ့- အေတြ ့ အၾကံဳ ရွိ research team နဲ ့ professional လုပ္ မွာ ပါ ။ volunteer ေခၚ ၿပီး ဒီ အတိုင္း Enumerator လုပ္ ခိုင္း မွာ မဟုတ္ ပါ ။ (၃) ရက္ ရက္ intensive training ေပး ၿပီး အဲ ဒီ training ထဲ က မွ လူ ထပ္ ေရြး ၿပီး field ထဲ လႊတ္ မွာ ပါ ။ \nရည္ ရြယ္ ခ်က္ က အမ်ား ျပည္ သူ နဲ ့ ဆိုင္ တဲ ့ မူဝါ ဒ ေတြ စီမံ ကိန္း ေတြ ေရး ဆြဲ ဖို ့ စဥ္း စား ရင္ research တို ့ survey တို ့ နဲ ့ သြား တဲ ့ အခါ အမ်ား ျပည္ သူ လို အပ္ ခ်က္ နဲ ့ ပို ၿပီး နီး စပ္ မယ္ လို ့ ယူ ဆတာ က တခ်က္ ။ \nေ( Stanford University က Design School ) မွာ policy design တခု နမူနာ ဆြဲ ဖို ့ ေက်ာင္း သား သင္ တန္း သား ေတြ ကို University Campus ထဲ မွာ survey လိုက္ လုပ္ ခိုင္း တယ္ ။ နာရီ အခ်ိန္ ေတာ့ သတ္ မွတ္ ေပး လိုက္ တယ္ ။ small skill ေပါ့ ။ အဲဒါ ေႏြ ရာ သီ Program ပဲ ရွိ ေသး တယ္ ။ public policy ကို ဘယ္ လို design လုပ္ မလဲ ဆို တာ ထည့္ ေပး တယ္ဆို ေတာ ့ ႏိုင္ငံတကာ မွာ university life ကို ျဖတ္ သန္း မယ္ ဆို research က မရွိ အျဖစ္ မသိမျဖစ္ topic ျဖစ္ လာ တယ္ ။။ က်မ တို ့ဆီမွာ ဒီ အေလ့ အထ အရမ္း နည္း တယ္ ေလ ။ ဆို ေတာ့ က ျမန္ မာ ျပည္ မွာ research & development ကို အား ထည့္ ေစ ခ်င္ တာ လည္း တခ်က္ ပါ ။ \nႏိုင္ ငံ တကာ အထူး သျဖင္ ့ ကိုယ္ ေတြ ့ သိသေလာက္ US မွာ ရွိ တဲ ့ public ေရာ private institution ေတြ မွာ သူ တို ့ နဲ ့ သက္ ဆိုင္ ရာ နယ္ ပယ္ ေတြ တိုင္း အတြက္ research ေတြ survey ေတြ အမ်ား ႀကီး လုပ္ ၾက တာ ပဲ ။ \nMaster တန္း ေက်ာင္း သား တိုင္း research paper ေတာ့ လုပ္ ၾက ရတယ္ ။ \nResearch Methodology သာ ကြာ ရင္ ကြာ ပါ မယ္ ။ \nState security ,\nMarket security ,အဆင့္ သတ္ မွတ္ ခ်က္ အေပၚ လိုက္ ၿပီး publicize လုပ္ မလား မလုပ္ ဖူး လား ဆို တာ ေတာ့ ကြာ ပါ တယ္ ။ \nေနာက္ၿပီး အဖြဲ ့ အစည္း ရဲ ့ မူ ပိုင္ ခြင့္ စသျဖင့္ လည္း စဥ္းစာရတာ ေတြ ရွိပါ လိမ့္ မယ္။"
}

